webpackJsonp([0x5cecab26a2df],{369:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Lenny's Blog",url:"https://leoasis.github.io"}},markdownRemark:{id:"/Users/lcrespo/github/leoasis.github.com/src/pages/2013-01-10-hello-world/index.md absPath of file >>> MarkdownRemark",html:'<p>Well, the title for my first post is kind of mandatory, right? No? Well,\nI did it anyway, so… whatever…</p>\n<p>I’ve been wanting to have a blog for some time right now, but I could never\nfind the time to actually do it. Guess the beginning of the year is a great\nmoment for starting stuff.</p>\n<p>What will you find here? Well, I’m mostly interested in web technology, so\nexpect a lot from that, but I may post about other things as well. Heck, it’s\nmy blog, so I can do whatever I want!</p>\n<p>I also want to thank <a href="https://twitter.com/holman">@holman</a>, from which I borrowed this Jekyll theme.\nI will start building my own style as time goes by, but this is great ground to\nstart building up.</p>\n<p>So well, this is it, short and sweet! Stay around for some upcoming stuff I have\nto share, and, when comments are enabled, give me some feedback! Or, as you\nknow, you can start giving me feedback through my <a href="https://twitter.com/leogcrespo">twitter account</a>.</p>\n<p>See ya!</p>',frontmatter:{title:"Hello, World!",date:"January 10, 2013"}}},pathContext:{path:"/hello-world"}}}});
